import React, { useState, useEffect } from "react";
import LoGo from "../Ramlogo.png";
import Mouth from "../mouth.png";
import { useParams } from "react-router";
import axios from "axios";
import BaseUrl from "../api/BaseUrl";
import ReactLoading from "react-loading";
import Barcode from "react-barcode";
import {
  formatYearMonthDayTime,
  formatDayMonthYearTimeThai,
  currentYearMonthDay,
} from "../utils/utils.js";
import urlencode from "urlencode";
import { nl2br } from 'react-js-nl2br';

function Report() {
  const [header, setHeader] = useState([]);
  const [patient, setPatient] = useState([]);
  const [userinfo, setUserinfo] = useState([]);
  const [paperinfo, setPaperinfo] = useState([]);
  const [transfer, setTransfer] = useState([]);
  const [vsinfo, setVsinfo] = useState([]);
  const [body, setBody] = useState();
  const [table, setTable] = useState("PTSTBL    ");
  const [type, setType] = useState("PTS1      ");
  const [done, setDone] = useState(true);
  const [ocr, setOcr] = useState([]);
  const { ocmnum, chtnum, seq, user } = useParams();
  const nl2br = require('react-nl2br');
  // const [userinfo, setUserinfo] = useState([]);
  const [teststate, setTeststate] = useState([]);
  const [teststate2, setTeststate2] = useState([]);
  const [teststate3, setTeststate3] = useState([]);

  //pre-op summary
  const opt6_opt037 = [{ "code": "OPT037001 ", "textValue": "", "dataType": "CODE", "chtnum": "900004 ", "require": "", "title": "Pre-op evaluated by Doctor", "type": "OPT6 ", "codeValue": "", "datetime": " ", "topic": "OPT037 ", "formNum": "2341", "ocmnum": "13454292 ", "user": " ", "table": "OPTNTBL " }, { "code": "OPT037002 ", "textValue": "WardText", "dataType": "RADIO", "chtnum": "900004 ", "require": "", "title": "Ward", "type": "OPT6 ", "codeValue": "N", "datetime": "202212221453", "topic": "OPT037 ", "formNum": "2341", "ocmnum": "13454292 ", "user": "W32 ", "seq": "93473", "table": "OPTNTBL " }, { "code": "OPT037003 ", "textValue": "ORText", "dataType": "RADIO", "chtnum": "900004 ", "require": "", "title": "OR", "type": "OPT6 ", "codeValue": "N", "datetime": "202212221453", "topic": "OPT037 ", "formNum": "2341", "ocmnum": "13454292 ", "user": "W32 ", "seq": "93474", "table": "OPTNTBL " }, { "code": "OPT037004 ", "textValue": "Other text", "dataType": "RADIO", "chtnum": "900004 ", "require": "", "title": "Other", "type": "OPT6 ", "codeValue": "Y", "datetime": "202212221453", "topic": "OPT037 ", "formNum": "2341", "ocmnum": "13454292 ", "user": "W32 ", "seq": "93475", "table": "OPTNTBL " }, { "code": "OPT037005 ", "textValue": "202212221411", "dataType": "DATETIME", "chtnum": "900004 ", "require": "", "title": "Date of operation", "type": "OPT6 ", "codeValue": "", "datetime": "202212221453", "topic": "OPT037 ", "formNum": "2341", "ocmnum": "13454292 ", "user": "W32 ", "seq": "93476", "table": "OPTNTBL " }, { "code": "OPT037006 ", "textValue": "", "dataType": "CODE", "chtnum": "900004 ", "require": "", "title": "Surgeon", "type": "OPT6 ", "codeValue": "", "datetime": " ", "topic": "OPT037 ", "formNum": "2341", "ocmnum": "13454292 ", "user": " ", "table": "OPTNTBL " }, { "code": "OPT037007 ", "textValue": "", "dataType": "CODE", "chtnum": "900004 ", "require": "", "title": "Anesthesiologist", "type": "OPT6 ", "codeValue": "", "datetime": " ", "topic": "OPT037 ", "formNum": "2341", "ocmnum": "13454292 ", "user": " ", "table": "OPTNTBL " }];


  let setData1 = [];
  let setData2 = [];
  let setData090 = [];

  let test1 = [];
  let test2 = [];
  let test3 = []

  const test3sample =[
    {
      "code": "OPT038001 ",
      "textValue": "Ga text",
      "dataType": "RADIO",
      "chtnum": "900004 ",
      "require": "",
      "title": "G.A.",
      "type": "OPT6 ",
      "codeValue": "N",
      "datetime": "202212221453",
      "topic": "OPT090 ",
      "formNum": "2341",
      "ocmnum": "13454292 ",
      "user": "W32 ",
      "seq": "93477",
      "table": "OPTNTBL "
    },
    {
      "code": "OPT038002 ",
      "textValue": "Ra text",
      "dataType": "RADIO",
      "chtnum": "900004 ",
      "require": "",
      "title": "R.A.",
      "type": "OPT6 ",
      "codeValue": "N",
      "datetime": "202212221453",
      "topic": "OPT090 ",
      "formNum": "2341",
      "ocmnum": "13454292 ",
      "user": "W32 ",
      "seq": "93478",
      "table": "OPTNTBL "
    },
    {
      "code": "OPT038003 ",
      "textValue": "Mac text",
      "dataType": "RADIO",
      "chtnum": "900004 ",
      "require": "",
      "title": "MAC Problem",
      "type": "OPT6 ",
      "codeValue": "N",
      "datetime": "202212221453",
      "topic": "OPT090 ",
      "formNum": "2341",
      "ocmnum": "13454292 ",
      "user": "W32 ",
      "seq": "93479",
      "table": "OPTNTBL "
    },
    {
      "code": "OPT038005 ",
      "textValue": "Previous text",
      "dataType": "TEXT",
      "chtnum": "900004 ",
      "require": "",
      "title": "Previous Medication",
      "type": "OPT6 ",
      "codeValue": "",
      "datetime": "202212221453",
      "topic": "OPT090 ",
      "formNum": "2341",
      "ocmnum": "13454292 ",
      "user": "W32 ",
      "seq": "93480",
      "table": "OPTNTBL "
    },
    {
      "code": "OPT038006 ",
      "textValue": "Family text",
      "dataType": "TEXT",
      "chtnum": "900004 ",
      "require": "",
      "title": "Family Hx",
      "type": "OPT6 ",
      "codeValue": "",
      "datetime": "202212221453",
      "topic": "OPT090 ",
      "formNum": "2341",
      "ocmnum": "13454292 ",
      "user": "W32 ",
      "seq": "93481",
      "table": "OPTNTBL "
    },
    {
      "code": "OPT038007 ",
      "textValue": "Alcohol text",
      "dataType": "RADIO",
      "chtnum": "900004 ",
      "require": "",
      "title": "Alcohol",
      "type": "OPT6 ",
      "codeValue": "N",
      "datetime": "202212221453",
      "topic": "OPT090 ",
      "formNum": "2341",
      "ocmnum": "13454292 ",
      "user": "W32 ",
      "seq": "93482",
      "table": "OPTNTBL "
    },
    {
      "code": "OPT038008 ",
      "textValue": "Smoking text",
      "dataType": "RADIO",
      "chtnum": "900004 ",
      "require": "",
      "title": "Smoking",
      "type": "OPT6 ",
      "codeValue": "Y",
      "datetime": "202212221453",
      "topic": "OPT090 ",
      "formNum": "2341",
      "ocmnum": "13454292 ",
      "user": "W32 ",
      "seq": "93483",
      "table": "OPTNTBL "
    },
    {
      "code": "OPT038009 ",
      "textValue": "Drugs text",
      "dataType": "RADIO",
      "chtnum": "900004 ",
      "require": "",
      "title": "Drugs Allergy",
      "type": "OPT6 ",
      "codeValue": "",
      "datetime": "202212221453",
      "topic": "OPT090 ",
      "formNum": "2341",
      "ocmnum": "13454292 ",
      "user": "W32 ",
      "seq": "93484",
      "table": "OPTNTBL "
    }
  ];

  useEffect(() => {
    getPatientInfo();
  }, []);

  const getPatientInfo = async () => {
    const request_Patient_Report = {
      params: {
        dbServiceName: "HSPatientInfo",
        ocmnum: ocmnum,
      },
    };
    await axios
      .get(
        `${BaseUrl.ram_internet_discharge_summary_newborn_patient_DBService_JSON_path}`,
        request_Patient_Report
      )
      .then((response) => {
        const responseData = response.data.result;
        setPatient(response.data.result);
        console.log("patient", responseData);
        getBody1();
        // getUserinfo();
        // getPaperinfo();
      })
      .catch((error) => {
        console.error(error);
      });
  };

  // useEffect(() => {
  //   getBody();
  // }, [header]);

  const getBody1 = async () => {
    let setRequst = [];
    for (let i = 37; i <= 60; i++) {
      const requestBody = {
        params: {
          dbServiceName: "SWPatientForm",
          ocmnum: ocmnum,
          chtnum: chtnum,
          table: "OPTNTBL",
          type: "OPT6",
          topic: "OPT0" + [i],
          seq: seq
        }
      };
      setRequst.push(
        await axios
          .get(
            `${BaseUrl.ram_internet_discharge_summary_newborn_patient_DBService_JSON_path}`,
            requestBody
          )
          .then((response) => {
            test1.push(response.data.result);
          })
          .catch((error) => console.error(error))
      );
    }
    console.log(test1, 'test1');
    setTeststate(test1);

    getBody2();
  }

  const getBody2 = async () => {
    let setRequst = [];
    for (let i = 61; i <= 75; i++) {
      const requestBody = {
        params: {
          dbServiceName: "SWPatientForm",
          ocmnum: ocmnum,
          chtnum: chtnum,
          table: "OPTNTBL",
          type: "OPT5",
          topic: "OPT0" + [i],
          seq: seq
        }
      };
      setRequst.push(
        await axios
          .get(
            `${BaseUrl.ram_internet_discharge_summary_newborn_patient_DBService_JSON_path}`,
            requestBody
          )
          .then((response) => {
            test2.push(response.data.result);
          })
          .catch((error) => console.error(error))
      );
    }
    console.log(test2, 'test2');
    setTeststate2(test2);
    getBody090();
  }

  const getBody090 = async () => {
    let setRequst = [];

    const requestBody = {

      params: {
        dbServiceName: "SWPatientForm",
        ocmnum: ocmnum,
        chtnum: chtnum,
        table: "OPTNTBL",
        type: "OPT5",
        topic: "OPT090",
        seq: seq
      }
    };
    setRequst.push(
      await axios
        .get(
          `${BaseUrl.ram_internet_discharge_summary_newborn_patient_DBService_JSON_path}`,
          requestBody
        )
        .then((response) => {
          // test3.push(response.data.result);
          test3.push(test3sample);

        })
        .catch((error) => console.error(error))
    );

    console.log(test3, 'test3');
    setTeststate3(test3);

    // if (setData.length > 0) {
    //   console.log("Body", setData);
    //   // await getOcrNumber();
    //   await getData();
    //   await setDone(true);
    // }
  }

  return (
    <>
      {teststate.length && teststate2.length && teststate3.length
        ?
        <div className=" ">
          {!done ? null : (
            <div className=" px-5 py-2 w-screen text-3xl font-bold shadow-lg items-center bg-slate-50 flex space-x-6 mb-3">
              {/* <img src={LoGo} className=" " width="300" alt="" /> */}
              <p classname="">Pre-Post Anesthesia Evaluation Record</p>
              <button
                onClick={window.print}
                className=" border-black rounded-md hover:bg-indigo-900 h-10  hover:text-white border parafont2 px-5 "
              >
                Print
              </button>
            </div>
          )}

          <div >
            <page
              size="A4"
              id="section-to-print"
              className="div-container-print "
            >
              <thead>
                {/* page1 */}
                <header className="grid grid-cols-3 parafont" style={{ marginBottom: "10px" }}>
                  <div className="header-1 ">
                    <div className="border border-black  border-r-0 border-b-0 pl-5 place-items-center">
                      <img src={LoGo} className=" w-11/12" alt="" />
                      {/* <div className="col-span-3 ">
              <p></p>
              <p className="text-xxs uppercase">Ramkhamhaeng Hospital</p>
              <p className="text-xxs">https://www.ram-hosp.co.th</p>
            </div> */}
                    </div>
                    <div className="border border-black border-r-0 grid grid-cols-4  place-items-center" style={{ height: "67px" }}>
                      <div className=" col-span-4 text-center">
                        <b>
                          Pre-Post Anesthesia Evaluation Record
                        </b>
                      </div>
                    </div>
                  </div>
                  <div className="border border-black border-r-0 p-1 -mr-10 space-y-1 pt-0.5">
                    {patient.map((data, i) => (
                      <>
                        <div key={i} className="flex space-x-4">
                          <p className="font-bold">Name:</p>
                          &nbsp;{data.name}
                        </div>
                        <div className="flex space-x-4">
                          <p className="font-bold">Birthday: </p>
                          &nbsp;{data.BirthDte}{" "}
                          <p className="font-bold">Age (Y.M.D):</p>
                          &nbsp;{data.age}
                        </div>
                        <div className="flex space-x-4 "></div>
                        <div className="flex space-x-4">
                          <p className="font-bold">HN: </p>
                          &nbsp;{data.hn}
                          <p className="font-bold">VN: </p>
                          &nbsp;{data.AN_VN}
                        </div>
                        <div className="flex space-x-4">
                          <p className="font-bold">Register date: </p>
                          {/* &nbsp;{data.registerDatetime} */}
                          <br />
                        </div>
                      </>
                    ))}
                  </div>
                  <div className="border overflow-hidden border-black ml-5 place-items-center center-kit">
                    {ocr.length > 0 ? (
                      <div className="text-white headertitleocr mt-1.5">
                        +{ocr[0].Return}+
                      </div>
                    ) : null}
                    <div className="hidden mt-7 font-thin">
                      {patient.map((data, i) => (
                        <Barcode
                          height="25"
                          width="1"
                          displayValue="false"
                          format="CODE39"
                          // textMargin={2}
                          // fontSize={20}
                          value={data.hn}
                        />
                      ))}
                    </div>
                  </div>
                </header>
              </thead>
              <tbody>
                <header className="grid grid-cols-1 parafont" style={{ marginBottom: "10px", lineHeight: "normal" }}>
                  <div className="header-1 ">
                    <div className="border border-black   border-b-0 pl-1 place-items-center">
                      {/* <div>
                      ............................................................................................................................................................................................
                    </div> */}
                      <div className=" grid grid-cols-5 gap-3 " style={{}}>
                        <div className=" col-span-3 parafont">
                          {teststate[0][0].textValue
                            ? <p className=" fontpage">Pre-op evaluated by Doctor : &emsp; {teststate[0][0].textValue} </p>
                            : <p className=" fontpage">Pre-op evaluated by Doctor :  ...................................................................................................................... at</p>
                          }
                        </div>


                        <div className=" col-span-2 ">
                          <div className=" grid grid-cols-4 gap-3 my-1" >
                            <div className=" col-span-1 fontpage">
                              <div id="squares">
                                {teststate[0][1].codeValue === "Y"
                                  ? <div id="square1"><p style={{ fontSize: "18px", marginTop: "-12px", marginLeft: "-1px" }}>&#10004;</p></div>
                                  : <div id="square1"></div>
                                }
                              </div>
                              ward
                            </div>
                            <div className=" col-span-1 fontpage">
                              <div id="squares">
                                {teststate[0][2].codeValue === "Y"
                                  ? <div id="square1"><p style={{ fontSize: "18px", marginTop: "-12px", marginLeft: "-1px" }}>&#10004;</p></div>
                                  : <div id="square1"></div>
                                }
                              </div>
                              OR
                            </div>

                            <div className=" col-span-2 fontpage">
                              {teststate[0][3].codeValue === "Y"
                                ?
                                <div id="squares">
                                  <div id="square1"><p style={{ fontSize: "18px", marginTop: "-12px", marginLeft: "-1px" }}>&#10004;</p></div>
                                  {teststate[0][3].textValue}
                                </div>

                                : <div id="squares"><div id="square1"></div>............................................</div>
                              }

                            </div>

                          </div>
                        </div>

                      </div>
                      <div className=" grid grid-cols-3 gap-3 " style={{}}>
                        <div className=" col-span-1 parafont">
                          {teststate[0][4].datetime
                            ? <p className=" fontpage">Date of Operation  &emsp;&emsp;{teststate[0][4].datetime.substring(6, 8)}/{teststate[0][4].datetime.substring(4, 6)}/{teststate[0][4].datetime.substring(0, 4)}</p>
                            : <p className=" fontpage">Date of Operation  ...................................................................</p>
                          }
                        </div>
                        <div className=" col-span-1 parafont">
                          {teststate[0][5].textValue
                            ? <p className=" fontpage">Surgeon  &emsp;&emsp;{teststate[0][5].textValue}</p>
                            : <p className=" fontpage">Surgeon  .................................................................................</p>
                          }
                        </div>
                        <div className=" col-span-1 parafont">
                          {teststate[0][6].textValue
                            ? <p className=" fontpage">Anesthesiologist  &emsp;&emsp;{teststate[0][6].textValue}</p>
                            : <p className=" fontpage">Anesthesiologist  ...................................................................</p>
                          }
                        </div>

                      </div>
                    </div>
                    <div className=" grid grid-cols-11  border border-black   border-b-0 " style={{}}>
                      <div className=" col-span-6 parafont border border-black  border-y-0 border-l-0 pl-1" style={{ lineHeight: "20px" }}>
                        <h3><b>HISTORY :</b></h3>
                        <div className=" grid grid-cols-6  " style={{}}>
                        <div className=" col-span-2 parafont">
                          <p className=" fontpage">Previous Anesthesia</p>
                        </div>
                        <div className=" col-span-1 fontpage">
                          <div id="squares">
                            {teststate3[0][0].codeValue === "Y"
                              ? <div id="square1"><p style={{ fontSize: "18px", marginTop: "-8px", marginLeft: "-1px" }}>&#10004;</p></div>
                              : <div id="square1"></div>
                            }
                          </div>
                          G.A
                        </div>
                        <div className=" col-span-1 fontpage" style={{ marginLeft: "-15px" }}>
                          <div id="squares">
                            {teststate3[0][1].codeValue === "Y"
                              ? <div id="square1"><p style={{ fontSize: "18px", marginTop: "-8px", marginLeft: "-1px" }}>&#10004;</p></div>
                              : <div id="square1"></div>
                            }
                          </div>
                          R.A
                        </div>
                        <div className=" col-span-2 fontpage" style={{ marginLeft: "-18px" }}>
                          {teststate3[0][2].codeValue === "Y"
                            ?
                            <div id="squares">
                              <div id="square1"><p style={{ fontSize: "18px", marginTop: "-8px", marginLeft: "-1px" }}>&#10004;</p></div>
                              {teststate3[0][2].textValue}
                            </div>

                            : <div id="squares"><div id="square1"></div>MAC Problem ............................</div>
                          }
                        </div>
                      </div>
                      {teststate3[0][3].textValue
                        ? <p className=" fontpage">Previous Medication  &emsp;&emsp;{teststate3[0][3].textValue}</p>
                        : <p className=" fontpage">Previous Medication  ...................................................................................................................................</p>
                      }
                      {teststate3[0][4].textValue
                        ? <p className=" fontpage">Family Hx  &emsp;&emsp;{teststate3[0][4].textValue}</p>
                        : <p className=" fontpage">Family Hx  ....................................................................................................................................................</p>
                      }
                      <div className=" grid grid-cols-4  " style={{ paddingLeft: "20px" }}>

                        <div className=" col-span-1 fontpage">
                          {teststate3[0][5].codeValue === "Y"
                            ?
                            <div id="squares">
                              <div id="square1"><p style={{ fontSize: "18px", marginTop: "-8px", marginLeft: "-1px" }}>&#10004;</p></div>
                              Alcohol
                            </div>

                            : <div id="squares"><div id="square1"></div>Alcohol</div>
                          }
                        </div>
                        <div className=" col-span-1 fontpage" style={{ marginLeft: "-15px" }}>
                          {teststate3[0][6].codeValue === "Y"
                            ?
                            <div id="squares">
                              <div id="square1"><p style={{ fontSize: "18px", marginTop: "-8px", marginLeft: "-1px" }}>&#10004;</p></div>
                              Smoking
                            </div>

                            : <div id="squares"><div id="square1"></div>Smoking</div>
                          }
                        </div>
                        <div className=" col-span-2 fontpage" style={{ marginLeft: "-18px" }}>
                          {teststate3[0][7].codeValue === "Y"
                            ?
                            <div id="squares">
                              <div id="square1"><p style={{ fontSize: "18px", marginTop: "-8px", marginLeft: "-1px" }}>&#10004;</p></div>
                              {teststate3[0][7].textValue}
                            </div>

                            : <div id="squares"><div id="square1"></div>Drugs Allergy .....................................................</div>
                          }
                        </div>
                      </div>
                        <h3><b>Personal Hx :</b></h3>
                        <div className=" grid grid-cols-8 gap-3 my-1" >
                          <div className=" col-span-3 parafont">
                            <p className=" fontpage">Functional Class [NYHA] :  </p></div>
                          <div className=" col-span-1 fontpage">
                            {teststate[3][0].codeValue === "Y"
                              ?
                              <div id="squares">
                                <div id="square1"><p style={{ fontSize: "18px", marginTop: "-8px", marginLeft: "-1px" }}>&#10004;</p></div>
                                1
                              </div>

                              : <div id="squares"><div id="square1"></div>1</div>
                            }
                          </div>
                          <div className=" col-span-1 fontpage">
                            {teststate[3][1].codeValue === "Y"
                              ?
                              <div id="squares">
                                <div id="square1"><p style={{ fontSize: "18px", marginTop: "-8px", marginLeft: "-1px" }}>&#10004;</p></div>
                                2
                              </div>

                              : <div id="squares"><div id="square1"></div>2</div>
                            }
                          </div>
                          <div className=" col-span-1 fontpage">
                            {teststate[3][2].codeValue === "Y"
                              ?
                              <div id="squares">
                                <div id="square1"><p style={{ fontSize: "18px", marginTop: "-8px", marginLeft: "-1px" }}>&#10004;</p></div>
                                3
                              </div>

                              : <div id="squares"><div id="square1"></div>3</div>
                            }
